import image from './hat.jpg'

const INITIAL_STATE = {
  womenOptions: [
    {
      title: 'hats',
      imageUrl: 'https://i.pinimg.com/originals/d1/45/58/d145581df75984eacb492ae268c28976.jpg',
      id: 1,
      linkUrl: 'shop/womens/hats'

    },
    {
      title: 'jackets',
      imageUrl: 'https://i.ibb.co/px2tCc3/jackets.png',
      id: 2,
      linkUrl: 'shop/jackets'
    },
    {
      title: 'sneakers',
      imageUrl: 'https://i.ibb.co/0jqHpnp/sneakers.png',
      id: 3,
      linkUrl: 'shop/sneakers'
    },
  ]
}

const genderOptionReducer = (state=INITIAL_STATE, action) => {
  switch(action.type) {
    default:
      return state
  }
}

export default genderOptionReducer
